import React from "react";
import 'bootstrap/dist/css/bootstrap.css';

export default function FundraisingProject() {
    return (
        <li>
            <div className="bg-light m-5 p-2">
                <h3 className="p-2">Title</h3>
                <div className="p-2">Description</div>
                <div className="row p-2">
                    <div className="col-sm">Founder</div>
                    <div className="col-sm">Goal</div>
                    <div className="col-sm">DueDate</div>
                    <div className="col-sm">Current balance</div>
                </div>
                <div>Tags</div>
            </div>
        </li>
    )
}
